    # Approach: Sliding Window + Monotonic Decreasing Queue
    # Time: O(n)
    # Space: O(n)
    def constrainedSubsetSum(self, nums: List[int], k: int) -> int:
        queue = deque()
        queue.append(0)
        result = nums[0]
        for idx in range(1, len(nums)):
            if queue[0] + k < idx:
                queue.popleft()
            nums[idx] += max(0, nums[queue[0]])
            result = max(result, nums[idx])
            while queue and nums[queue[-1]] < nums[idx]:
                queue.pop()
            queue.append(idx)
        return result

